import React from "../../img/html.png";
import CSS from "../../img/css.png";
import SASS from "../../img/sass.png";
import BS from "../../img/bootstrap.png";

const CardData = [
  {
    imgsrc: React,
    title: "Html",
  },
  {
    imgsrc: CSS,
    title: "css",
  },
  {
    imgsrc: SASS,
    title: "sass",
  },
  {
    imgsrc: BS,
    title: "bootstrap 5",
  },
];

export default CardData;
